import React from 'react';
import TextField from '@material-ui/core/TextField';

import Facebook from '../../resources/images/icons/path4487.png';
import Instagram from '../../resources/images/icons/path2.png';

const styles = theme => ({
    container: {
      display: 'flex',
      flexWrap: 'wrap',
    },
    textField: {
      marginLeft: theme.spacing.unit,
      marginRight: theme.spacing.unit,
    },
    dense: {
      marginTop: 16,
    },
    menu: {
      width: 200,
    },
  });

  handleChange = name => event => {
    this.setState({
      [name]: event.target.value,
    });
  };

const Contactanos = () => {

    return (
        <div className="contactanos_wrapper">
            <div className="iconos">
                <form>
                <TextField
                    id="outlined-name"
                    label="Name"


                    margin="normal"
                    variant="outlined"
                />
                </form>

                <list>

                    <a href="https://www.facebook.com/Ment-409357773178947" target="_blank">

                    <img src={Facebook} alt="foto" width='40px'/>
                    </a>

                    <a href="https://www.instagram.com/ment.soluciones" target="_blank">

                    <img src={Instagram} alt="foto" width='40px'/>
                    </a>
                </list>
            </div>
        </div>
    );
};

export default Contactanos;
